Corrigindo: "Carla Zambelli saca arma e DÁ VOZ DE PRISÃO...

Código de Processo Penal:

Art. 301. Qualquer do povo poderá e as autoridades policiais e seus agentes deverão prender quem quer que seja encontrado em flagrante delito.

Art. 302. Considera-se em flagrante delito quem:

I - está cometendo a infração penal;

II - acaba de cometê-la;

III - é perseguido, logo após, pela autoridade, pelo ofendido ou por qualquer pessoa, em situação que faça presumir ser autor da infração;

O cara xinga, empurra, totalmente violento, bem mais forte do que a vítima. A deputada dá voz de prisão nele, ele corre, e a deputada não pode agir em exercício regular de direito?

Vocês são uns vagabundos; os caras agrediram ela; verbal e fisicamente; cuspiram, fizeram um monte; mostra o antes mídia podre; seus lixos; 

Esse tipo de vagabundo covarde tem que pagar o preço mesmo..
Graças a Deus que ela e os demais estavam armados
